import React from "react";
import {Card} from "react-bootstrap";
import '../components/styles/contactUs.css';

const ContauctUs = (props) => {

    return(
        <div className='ContauctUs col-4 gx-1'>
                <Card className='ContactUs-card'>
                    <Card.Img className='CardImg' src={props.card.image}></Card.Img>
                    <Card.Title>
                        {props.card.title}
                    </Card.Title>
                    <Card.Text>
                        {props.card.content1}<br/>
                        {props.card.content2}
                    </Card.Text>
                </Card>
        </div>
    );
};

export default ContauctUs;
